import axios from 'axios';
export const handleSigninApi = (phone, password, type) => {
    if(type === 1)
        return axios.post('/api/login/customer');
    else if (type === 2)
        return axios.post('api/login/staff');
    else if (type === 3)
        return axios.post('/api/login/admin');
}
